contracts/SimpleStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

contract SimpleStorage {

    Student public stu = Student({id: 1, name : "chris"}); // object
    Student[] public stus; // array
    mapping(uint256 => string) public stuMap; 

    struct Student {
        uint256 id;
        string name;
    }

    function addStu (uint256 _id, string memory _name) public {
        stus.push(Student(_id, _name));
        stuMap[_id] = _name;
    }

    bool isDeleted = false;
    int256 x = 13;
    uint256 y = 2;
    address test = 0xf8e81D47203A594245E36C48e151709F0C19fBe8;
    string name = "chris";
    bytes32 myBytes = "cat"; // 默认internal

    uint256 public fNo; // public默认设置了get


    function test1(uint256 _fNo) public virtual {   
        fNo = _fNo;
    }

    function test2() public view returns(uint256) {   
        return fNo;
    }

    function test3() public pure returns(uint256) {   
        return 1 + 1;
    }







}

